import { ReactNode } from 'react';

const Button = ({
	children,
	className,
}: {
	children?: ReactNode;
	className?: string;
}) => {
	return (
		<a
			className={`bg-primary-color py-3 px-14 text-primary-text font-bold rounded-full flex items-center ${
				className || ''
			}`}
		>
			{children || 'No text'}
		</a>
	);
};

export default Button;
